///// QUOTES //////////////\n  $scope.quotes = function () {\n    var quotes = quotesService.quotes;\n    var randomQuote = Math.floor(Math.random() * quotes.length);\n    $scope.quote = quotes[randomQuote];\n  };\n  $scope.quotes();\n});\n'use strict';\n\nangular.module('app').directive('myEnter', function () {\n  return function (scope, element, attrs) {\n    element.bind('keydown keypress', function (event) {\n      if (event.which === 13) {\n        scope.$apply(function () {\n          scope.$eval(attrs.myEnter);\n        });\n        event.preventDefault();\n      }\n    });\n  };\n});\n'use strict';\n\nangular.module('app').service('backgroundService', function () {\n                        this.backgroundImages = ['frontend/img/ales-krivec-2892.jpg', 'frontend/img/jason-ortego-5386.jpg', 'frontend/img/jon-flobrant-32821.jpg', 'frontend/img/luca-zanon-26595.jpg', 'frontend/img/luis-poletti-17300.jpg', 'frontend/img/luke-pamer-7319.jpg', 'frontend/img/milos-simic-351441.jpg', 'frontend/img/regis-freyd-275512.jpg', 'frontend/img/robert-crawford-12905.jpg', 'frontend/img/sam-ferrara-270946.jpg', 'frontend/img/simon-matzinger-320332.jpg', 'frontend/img/topich-991.jpg'];\n});\n'use strict';\n\nangular.module('app').service('quotesService', function () {\n  this.quotes = [{ 'author': 'H. Jackson Brown, Jr.', 'quote': 'The best preparation for tomorrow is doing your best today.' }, { 'author': 'Francis of Assisi', 'quote': 'Start by doing what\\'s necessary; then do what\\'s possible; and suddenly you are doing the impossible.' }, { 'author': 'Norman Vincent Peale', 'quote': 'Change your thoughts and you change your world.' }, { 'author': 'Aesop', 'quote': 'No act of kindness, no matter how small, is ever wasted.' }, { 'author': 'Milton Berle', 'quote': 'If opportunity doesnt\\'t knock, build a door.' }, { 'author': 'Theodore Roosevelt', 'quote': 'Belive you can and you\\'re half way there.' }, { 'author': 'Democritus', 'quote': 'Happiness resides not in possessions, and not in gold, happiness dwells in the soul.' }, { 'author': 'Tony Robbins', 'quote': 'We can change our lives. We can do, have, and be exactly what we wish.' }, { 'author': 'Theodore Roethke', 'quote': 'What we need is more people who specialize in the impossible.' }, { 'author': 'Wayne Gretzky', 'quote': 'You miss 100 percent of the shots you never take.' }];\n});\n'use strict';\n\nangular.module('app').service('weatherService', function ($http) {\n  var URL = 'http://api.openweathermap.org/data/2.5/forecast?id=5781004&APPID=f9b3c4e0067e9d150a154256de430243&units=imperial';\n\n  this.getWeather = function () {\n    return $http.get(URL).then(function (response) {\n      return response.data;\n    });\n  };\n});","angular.module('app', ['ui.router']).config(function($stateProvider, $urlRouterProvider) {\n\n  $urlRouterProvider.otherwise('/');\n\n  $stateProvider\n    .state('home', {\n      url: '/',\n      templateUrl: '/frontend/views/home.html',\n      controller: 'mainCtrl'\n    })\n\n});\n","angular.module('app').controller('mainCtrl', function($scope, $rootScope, backgroundService, quotesService, weatherService) {\n\n\n\n  ////////////// TIME //////////////\n  $scope.time = moment().format('h:mm ');\n\n  ////////////// GET NAME //////////////\n  $scope.getName = function (name, $event) {\n    event.preventDefault();\n    console.log('name', name);\n    $scope.name = name;\n  }\n\n  ////////////// BACKGROUND IMAGES //////////////\n  $rootScope.backgroundImages = function() {\n    let images = backgroundService.backgroundImages;\n    let randomNumber = Math.floor(Math.random() * images.length);\n    let randomImage = images[randomNumber];\n    // console.log(randomImage);\n    return {\n      \"background-image\": 'url(' + randomImage + ')'\n    };\n  };\n  $rootScope.backgroundImages();\n  console.log($scope.backgroundImages());\n\n  ////////////// WEATHER //////////////\n  weatherService.getWeather().then(function(response) {\n    $scope.city = response.city.name;\n    console.log($scope.city);\n    $scope.weather = Math.floor(response.list[0].main.temp);\n    console.log($scope.weather);\n    $scope.icon = response.list[0].weather[0].icon + '.svg';\n    console.log($scope.icon);\n  });\n\n  ////////////// QUOTES //////////////\n  $scope.quotes = function() {\n    let quotes = quotesService.quotes;\n    let randomQuote = Math.floor(Math.random() * quotes.length);\n    $scope.quote = quotes[randomQuote];\n\n  }\n  $scope.quotes();\n\n});\n","angular.module('app').directive('myEnter', function() {\n  return function(scope, element, attrs) {\n    element.bind('keydown keypress', function(event) {\n      if(event.which === 13) {\n        scope.$apply(function() {\n          scope.$eval(attrs.myEnter);\n          \n        });\n        event.preventDefault();\n      }\n    });\n  };\n});\n","angular.module('app').service('backgroundService', function() {\n  this.backgroundImages = ['frontend/img/ales-krivec-2892.jpg',\n                          'frontend/img/jason-ortego-5386.jpg',\n                          'frontend/img/jon-flobrant-32821.jpg',\n                          'frontend/img/luca-zanon-26595.jpg',\n                          'frontend/img/luis-poletti-17300.jpg',\n                          'frontend/img/luke-pamer-7319.jpg',\n                          'frontend/img/milos-simic-351441.jpg',\n                          'frontend/img/regis-freyd-275512.jpg',\n                          'frontend/img/robert-crawford-12905.jpg',\n                          'frontend/img/sam-ferrara-270946.jpg',\n                          'frontend/img/simon-matzinger-320332.jpg',\n                          'frontend/img/topich-991.jpg'\n                        ];\n\n\n\n})\n","angular.module('app').service('quotesService', function() {\n  this.quotes = [\n    {'author': 'H. Jackson Brown, Jr.', 'quote': 'The best preparation for tomorrow is doing your best today.'},\n    {'author': 'Francis of Assisi', 'quote': 'Start by doing what\\'s necessary; then do what\\'s possible; and suddenly you are doing the impossible.'},\n    {'author': 'Norman Vincent Peale', 'quote': 'Change your thoughts and you change your world.'},\n    {'author': 'Aesop', 'quote': 'No act of kindness, no matter how small, is ever wasted.'},\n    {'author': 'Milton Berle', 'quote': 'If opportunity doesnt\\'t knock, build a door.'},\n    {'author': 'Theodore Roosevelt', 'quote': 'Belive you can and you\\'re half way there.'},\n    {'author': 'Democritus', 'quote': 'Happiness resides not in possessions, and not in gold, happiness dwells in the soul.'},\n    {'author': 'Tony Robbins', 'quote': 'We can change our lives. We can do, have, and be exactly what we wish.'},\n    {'author': 'Theodore Roethke', 'quote': 'What we need is more people who specialize in the impossible.'},\n    {'author': 'Wayne Gretzky', 'quote': 'You miss 100 percent of the shots you never take.'}\n  ]\n})\n","angular.module('app').service('weatherService', function($http) {\n  const URL = 'http://api.openweathermap.org/data/2.5/forecast?id=5781004&APPID=f9b3c4e0067e9d150a154256de430243&units=imperial';\n\n  this.getWeather = function() {\n    return $http.get(URL).then(function(response) {\n      return response.data;\n    })\n  }\n\n\n});\n"]}